import { 
    ORDER_CREATE_FAIL, 
    ORDER_CREATE_REQUEST, 
    ORDER_CREATE_SUCCESS,

    ORDER_CREATE_RESET,

    ORDER_DETAILS_FAIL,
    ORDER_DETAILS_REQUEST,
    ORDER_DETAILS_SUCCESS,

    ORDER_PAY_FAIL,
    ORDER_PAY_REQUEST,
    ORDER_PAY_SUCCESS,
    ORDER_PAY_RESET,

    ORDER_LIST_MY_FAIL,
    ORDER_LIST_MY_REQUEST,
    ORDER_LIST_MY_SUCCESS,
    ORDER_LIST_MY_RESET,

    ORDER_PROMO_CODE_LIST_FAIL,
    ORDER_PROMO_CODE_LIST_REQUEST,
    ORDER_PROMO_CODE_LIST_SUCCESS,

    ORDER_PROMO_CODE_DELETE_FAIL,
    ORDER_PROMO_CODE_DELETE_REQUEST,
    ORDER_PROMO_CODE_DELETE_SUCCESS,

    ORDER_PROMO_CODE_CREATE_FAIL,
    ORDER_PROMO_CODE_CREATE_REQUEST,
    ORDER_PROMO_CODE_CREATE_SUCCESS,
    ORDER_PROMO_CODE_CREATE_RESET,

    ORDER_PROMO_CODE_DETAILS_FAIL,
    ORDER_PROMO_CODE_DETAILS_REQUEST,
    ORDER_PROMO_CODE_DETAILS_SUCCESS,

    ORDER_PROMO_CODE_UPDATE_FAIL,
    ORDER_PROMO_CODE_UPDATE_REQUEST,
    ORDER_PROMO_CODE_UPDATE_SUCCESS,
    ORDER_PROMO_CODE_UPDATE_RESET,

    ORDER_LIST_FAIL,
    ORDER_LIST_REQUEST,
    ORDER_LIST_SUCCESS,

    ORDER_DELIVER_FAIL,
    ORDER_DELIVER_REQUEST,
    ORDER_DELIVER_SUCCESS,
    ORDER_DELIVER_RESET,

    ORDER_DELETE_FAIL,
    ORDER_DELETE_REQUEST,
    ORDER_DELETE_SUCCESS,
} from '../constants/orderConstants'


export const orderCreateReducer = (state={}, action) => {
    switch(action.type) {
        case ORDER_CREATE_REQUEST:
            return {
                loading: true
            }
        
        case ORDER_CREATE_SUCCESS:
            return {
                loading: false,
                success: true,
                order: action.payload
            }
        
        case ORDER_CREATE_FAIL:
            return {
                loading: false,
                error: action.payload
            }
        
        case ORDER_CREATE_RESET:
            return {

            }

        default:
            return state
                
    }
}


export const orderDetailsReducer = (state={loading: true, orderItems: [], shippingAddress: {}}, action) => {
    switch(action.type) {
        case ORDER_DETAILS_REQUEST:
            return {
                ...state,
                loading: true
            }
        
        case ORDER_DETAILS_SUCCESS:
            return {
                loading: false,
                order: action.payload
            }
        
        case ORDER_DETAILS_FAIL:
            return {
                loading: false,
                error: action.payload
            }

        default:
            return state
                
    }
}


