export const promoCodeReducer = (state = { promoCodes: [] }, action) => {
    switch (action.type) {
        case ORDER_PROMO_CODE_LIST_REQUEST:
            return {
                loading: true
            }
        
        case ORDER_PROMO_CODE_LIST_SUCCESS:
            return {
                loading: false,
                promoCodes: action.payload
            }
        
        case ORDER_PROMO_CODE_LIST_FAIL:
            return {
                loading: false,
                error: action.payload
            }

        default:
            return state
    }
}


export const promoCodeDeleteReducer = (state={ }, action) => {
    switch(action.type){
        case ORDER_PROMO_CODE_DELETE_REQUEST:
            return { loading: true}

        case ORDER_PROMO_CODE_DELETE_SUCCESS:
            return { loading: false, success: true }

        case ORDER_PROMO_CODE_DELETE_FAIL:
            return { loading: false, error: action.payload }

        default:
            return state
    }
}


export const promoCodeCreateReducer = (state = {}, action) => {
    switch (action.type) {
        case ORDER_PROMO_CODE_CREATE_REQUEST:
            return { loading: true }

        case ORDER_PROMO_CODE_CREATE_SUCCESS:
            return { loading: false, success: true, promoCode: action.payload }

        case ORDER_PROMO_CODE_CREATE_FAIL:
            return { loading: false, error: action.payload }

        case ORDER_PROMO_CODE_CREATE_RESET:
            return {  }

        default:
            return state
    }
}


export const promoCodeDetailsReducer = (state={promoCode:{}}, action) => {
    switch(action.type){
        case ORDER_PROMO_CODE_DETAILS_REQUEST:
            return {loading: true, ...state}

        case ORDER_PROMO_CODE_DETAILS_SUCCESS:
            return {loading: false, promoCode: action.payload}

        case ORDER_PROMO_CODE_DETAILS_FAIL:
            return {loading: false, error: action.payload}

        default:
            return state
    }
}


export const promoCodeUpdateReducer = (state = {promoCode: {}}, action) => {
    switch (action.type) {
        case ORDER_PROMO_CODE_UPDATE_REQUEST:
            return { loading: true }

        case ORDER_PROMO_CODE_UPDATE_SUCCESS:
            return { loading: false, success: true, product: action.payload }

        case ORDER_PROMO_CODE_UPDATE_FAIL:
            return { loading: false, error: action.payload }

        case ORDER_PROMO_CODE_UPDATE_RESET:
            return { promoCode: {} }

        default:
            return state
    }
}


export const orderDeleteReducer = (state = {}, action) => {
    switch (action.type) {
        case ORDER_DELETE_REQUEST:
            return { loading: true }

        case ORDER_DELETE_SUCCESS:
            return { loading: false, success: true }

        case ORDER_DELETE_FAIL:
            return { loading: false, error: action.payload }

        default:
            return state
    }
}
